import React from 'react';
import Heading from './Header';
import Footer from './Footer';
import Note from './Note';
import notes from './notes';


function createCard(){
    return (<Note 
        title= "This is the note title"
        content = "This is the note content"

    />);
}

function App(){
    return <div>
    <Heading />
    {notes.maps(createCard)}
    <Footer />
    </div>
}

export default App;
